if (/i(Phone|Pad|Pod|OS)/.test(navigator.userAgent)) {
  document.write(
    '<meta name="viewport" content="width=device-width, minimum-scale=1, ' +
    'maximum-scale=1,target-densitydpi=device-dpi,user-scalable=no">');
} else {
  document.write(
    '<meta name="viewport" content="width=device-width, minimum-scale=1, ' +
    'maximum-scale=1,target-densitydpi=150">');
}
